import React from 'react'

import styled from 'styled-components';

import { withStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';

import Parallax from 'react-rellax';

import TrainingBot from "../images/Trainingbot.png"

function Portfolio(props) {
    const { classes } = props;
    return (
        <PortfolioWrapper>
            <Parallax
                centered={true}
                speed={1}>
                <h3>Portfolio</h3>
            </Parallax>
            <hr />
            <div>
                <Card className={classes.card}>
                    <CardActionArea>
                        <CardMedia
                            className={classes.media}
                            image={TrainingBot}
                            title="Contemplative Reptile"
                        />
                        <CardContent>
                            <Typography gutterBottom variant="h5" component="h2">
                                Training Bot
                        </Typography>
                            <Typography component="p">
                                "Training Bot" is an application to make distributing training information for employees simple.
                                Set up an account, ass your employees, and automate message sending via email, slack, or text message.
                        </Typography>
                        </CardContent>
                    </CardActionArea>
                    <CardActions>
                        <Button size="small" color="primary">
                            Git Hub
                    </Button>
                        <Button size="small" color="primary">
                            Live Demo
                    </Button>
                    </CardActions>
                </Card>
                <Card className={classes.card}>
                    <CardActionArea>
                        <CardMedia
                            className={classes.media}
                            image={TrainingBot}
                            title="Contemplative Reptile"
                        />
                        <CardContent>
                            <Typography gutterBottom variant="h5" component="h2">
                                Training Bot
                        </Typography>
                            <Typography component="p">
                                "Training Bot" is an application to make distributing training information for employees simple.
                                Set up an account, ass your employees, and automate message sending via email, slack, or text message.
                        </Typography>
                        </CardContent>
                    </CardActionArea>
                    <CardActions>
                        <Button size="small" color="primary">
                            Git Hub
                    </Button>
                        <Button size="small" color="primary">
                            Live Demo
                    </Button>
                    </CardActions>
                </Card>
                <Card className={classes.card}>
                    <CardActionArea>
                        <CardMedia
                            className={classes.media}
                            image={TrainingBot}
                            title="Contemplative Reptile"
                        />
                        <CardContent>
                            <Typography gutterBottom variant="h5" component="h2">
                                Training Bot
                        </Typography>
                            <Typography component="p">
                                "Training Bot" is an application to make distributing training information for employees simple.
                                Set up an account, ass your employees, and automate message sending via email, slack, or text message.
                        </Typography>
                        </CardContent>
                    </CardActionArea>
                    <CardActions>
                        <Button size="small" color="primary">
                            Git Hub
                    </Button>
                        <Button size="small" color="primary">
                            Live Demo
                    </Button>
                    </CardActions>
                </Card>
                <Card className={classes.card}>
                    <CardActionArea>
                        <CardMedia
                            className={classes.media}
                            image={TrainingBot}
                            title="Contemplative Reptile"
                        />
                        <CardContent>
                            <Typography gutterBottom variant="h5" component="h2">
                                Training Bot
                        </Typography>
                            <Typography component="p">
                                "Training Bot" is an application to make distributing training information for employees simple.
                                Set up an account, ass your employees, and automate message sending via email, slack, or text message.
                        </Typography>
                        </CardContent>
                    </CardActionArea>
                    <CardActions>
                        <Button size="small" color="primary">
                            Git Hub
                    </Button>
                        <Button size="small" color="primary">
                            Live Demo
                    </Button>
                    </CardActions>
                </Card>
            </div>
        </PortfolioWrapper >
    )
}

const styles = {
    card: {
        maxWidth: 405,
        margin: 20
    },
    media: {
        height: 140,
    },
};

export default withStyles(styles)(Portfolio);

const PortfolioWrapper = styled.div`
    width: 100vw;
    padding: 20px;
    min-height: 100vh;
    background: #2E3440;
    div{
        width: 100%;
        display: flex;
        justify-content: center;
        align-items: center;
        flex-wrap: wrap;
    }
    h3{
        color: white;
        font-size: 45px;
        margin: 0;
        padding: 0;
    }
`;
